component.schema:
{
 "description": "Cluster is the Schema for the Clusters API",
 "properties": {
  "spec": {
   "description": "ClusterSpec defines the desired state of Cluster.\n\n\nAn object representing an Amazon EKS cluster.",
   "properties": {
    "accessConfig": {
     "description": "The access configuration for the cluster.",
     "properties": {
      "authenticationMode": {
       "type": "string"
      },
      "bootstrapClusterCreatorAdminPermissions": {
       "type": "boolean"
      }
     },
     "type": "object"
    },
    "clientRequestToken": {
     "description": "A unique, case-sensitive identifier that you provide to ensure the idempotency\nof the request.",
     "type": "string"
    },
    "encryptionConfig": {
     "description": "The encryption configuration for the cluster.",
     "items": {
      "description": "The encryption configuration for the cluster.",
      "properties": {
       "provider": {
        "description": "Identifies the Key Management Service (KMS) key used to encrypt the secrets.",
        "properties": {
         "keyARN": {
          "type": "string"
         }
        },
        "type": "object"
       },
       "resources": {
        "items": {
         "type": "string"
        },
        "type": "array"
       }
      },
      "type": "object"
     },
     "type": "array"
    },
    "kubernetesNetworkConfig": {
     "description": "The Kubernetes network configuration for the cluster.",
     "properties": {
      "ipFamily": {
       "type": "string"
      },
      "serviceIPv4CIDR": {
       "type": "string"
      }
     },
     "type": "object"
    },
    "logging": {
     "description": "Enable or disable exporting the Kubernetes control plane logs for your cluster\nto CloudWatch Logs. By default, cluster control plane logs aren't exported\nto CloudWatch Logs. For more information, see Amazon EKS Cluster control\nplane logs (https://docs.aws.amazon.com/eks/latest/userguide/control-plane-logs.html)\nin the Amazon EKS User Guide .\n\n\nCloudWatch Logs ingestion, archive storage, and data scanning rates apply\nto exported control plane logs. For more information, see CloudWatch Pricing\n(http://aws.amazon.com/cloudwatch/pricing/).",
     "properties": {
      "clusterLogging": {
       "items": {
        "description": "An object representing the enabled or disabled Kubernetes control plane logs\nfor your cluster.",
        "properties": {
         "enabled": {
          "type": "boolean"
         },
         "types": {
          "items": {
           "type": "string"
          },
          "type": "array"
         }
        },
        "type": "object"
       },
       "type": "array"
      }
     },
     "type": "object"
    },
    "name": {
     "description": "The unique name to give to your cluster.",
     "type": "string"
    },
    "outpostConfig": {
     "description": "An object representing the configuration of your local Amazon EKS cluster\non an Amazon Web Services Outpost. Before creating a local cluster on an\nOutpost, review Local clusters for Amazon EKS on Amazon Web Services Outposts\n(https://docs.aws.amazon.com/eks/latest/userguide/eks-outposts-local-cluster-overview.html)\nin the Amazon EKS User Guide. This object isn't available for creating Amazon\nEKS clusters on the Amazon Web Services cloud.",
     "properties": {
      "controlPlaneInstanceType": {
       "type": "string"
      },
      "controlPlanePlacement": {
       "description": "The placement configuration for all the control plane instances of your local\nAmazon EKS cluster on an Amazon Web Services Outpost. For more information,\nsee Capacity considerations (https://docs.aws.amazon.com/eks/latest/userguide/eks-outposts-capacity-considerations.html)\nin the Amazon EKS User Guide.",
       "properties": {
        "groupName": {
         "type": "string"
        }
       },
       "type": "object"
      },
      "outpostARNs": {
       "items": {
        "type": "string"
       },
       "type": "array"
      }
     },
     "type": "object"
    },
    "resourcesVPCConfig": {
     "description": "The VPC configuration that's used by the cluster control plane. Amazon EKS\nVPC resources have specific requirements to work properly with Kubernetes.\nFor more information, see Cluster VPC Considerations (https://docs.aws.amazon.com/eks/latest/userguide/network_reqs.html)\nand Cluster Security Group Considerations (https://docs.aws.amazon.com/eks/latest/userguide/sec-group-reqs.html)\nin the Amazon EKS User Guide. You must specify at least two subnets. You\ncan specify up to five security groups. However, we recommend that you use\na dedicated security group for your cluster control plane.",
     "properties": {
      "endpointPrivateAccess": {
       "type": "boolean"
      },
      "endpointPublicAccess": {
       "type": "boolean"
      },
      "publicAccessCIDRs": {
       "items": {
        "type": "string"
       },
       "type": "array"
      },
      "securityGroupIDs": {
       "items": {
        "type": "string"
       },
       "type": "array"
      },
      "securityGroupRefs": {
       "description": "Reference field for SecurityGroupIDs",
       "items": {
        "description": "AWSResourceReferenceWrapper provides a wrapper around *AWSResourceReference\ntype to provide more user friendly syntax for references using 'from' field\nEx:\nAPIIDRef:\n\n\n\tfrom:\n\t  name: my-api",
        "properties": {
         "from": {
          "description": "AWSResourceReference provides all the values necessary to reference another\nk8s resource for finding the identifier(Id/ARN/Name)",
          "properties": {
           "name": {
            "type": "string"
           }
          },
          "type": "object"
         }
        },
        "type": "object"
       },
       "type": "array"
      },
      "subnetIDs": {
       "items": {
        "type": "string"
       },
       "type": "array"
      },
      "subnetRefs": {
       "description": "Reference field for SubnetIDs",
       "items": {
        "description": "AWSResourceReferenceWrapper provides a wrapper around *AWSResourceReference\ntype to provide more user friendly syntax for references using 'from' field\nEx:\nAPIIDRef:\n\n\n\tfrom:\n\t  name: my-api",
        "properties": {
         "from": {
          "description": "AWSResourceReference provides all the values necessary to reference another\nk8s resource for finding the identifier(Id/ARN/Name)",
          "properties": {
           "name": {
            "type": "string"
           }
          },
          "type": "object"
         }
        },
        "type": "object"
       },
       "type": "array"
      }
     },
     "type": "object"
    },
    "roleARN": {
     "description": "The Amazon Resource Name (ARN) of the IAM role that provides permissions\nfor the Kubernetes control plane to make calls to Amazon Web Services API\noperations on your behalf. For more information, see Amazon EKS Service IAM\nRole (https://docs.aws.amazon.com/eks/latest/userguide/service_IAM_role.html)\nin the Amazon EKS User Guide .",
     "type": "string"
    },
    "roleRef": {
     "description": "AWSResourceReferenceWrapper provides a wrapper around *AWSResourceReference\ntype to provide more user friendly syntax for references using 'from' field\nEx:\nAPIIDRef:\n\n\n\tfrom:\n\t  name: my-api",
     "properties": {
      "from": {
       "description": "AWSResourceReference provides all the values necessary to reference another\nk8s resource for finding the identifier(Id/ARN/Name)",
       "properties": {
        "name": {
         "type": "string"
        }
       },
       "type": "object"
      }
     },
     "type": "object"
    },
    "tags": {
     "additionalProperties": {
      "type": "string"
     },
     "description": "Metadata that assists with categorization and organization. Each tag consists\nof a key and an optional value. You define both. Tags don't propagate to\nany other cluster or Amazon Web Services resources.",
     "type": "object"
    },
    "version": {
     "description": "The desired Kubernetes version for your cluster. If you don't specify a value\nhere, the default version available in Amazon EKS is used.\n\n\nThe default version might not be the latest version available.",
     "type": "string"
    }
   },
   "required": [
    "name",
    "resourcesVPCConfig"
   ],
   "type": "object"
  }
 },
 "title": "Cluster",
 "type": "object"
}
